    false,nt"url": null,nt"notes": "This narrative report for Des Lacs and
    Lostwood National Wildlife Refuges outlines Refuge accomplishments from August through
    October of 1938. The report begins by summarizing the weather conditions and water
    conditions during this period. Wildlife- including migratory birds and upland game
    birds- is also covered. The Refuge development and maintenance section discusses
    physical developments. A progress report on field investigations and applied research
    is also provided. The public relations section of the report describes recreational
    uses. Photographs are attached.",nt"license_title": "License Not Specified",nt"extras":
